import React, { useEffect } from 'react';
import axios from 'axios';
import { useState } from 'react';

const Home = () => {

    const [jokes, setJokes] = useState({});

    useEffect(() => {
        axios.get('http://localhost:3000/jokes')
    })
    return (
        <div>

            <h1>test</h1>

        </div>
    )
}

export default Home;
